import { Button } from "react-native";
import './Style.css'

function NavBar() {
    return(
        <>
            <Button className="home-button" /*onClick={navHome}*/>
                <Text style={styles.buttonText}>Home</Text>
            </Button>
            home
            criminals
            sentences
            officers
            crimes
            charges
        </>
    )
}

const styles = StyleSheet.create({
    buttonText: {
        fontSize: 35,
        fontWeight: 'normal',
        color: 'black',
        top: 30,
    }
})

export default NavBar;
